  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0130796 includes physical
  and profile data collected aboard the THOMAS JEFFERSON during project OPR-B310-TJ-09
  in the North Atlantic Ocean from 2009-09-12 to 2009-11-09. These data include SOUND
  VELOCITY. The instruments used to collect these data include CTD and sound velocimeter
  - moving vessel profiler. These data were collected and submitted by the NOAA Office
  of Coast Survey in support of hydrographic multibeam surveys to meet NOAA charting
  requirements.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
